@Component({
  selector: 'app-header',
  templateUrl: './header.component.html',
  styleUrls: ['./header.component.css']
})
export class HeaderComponent {

}
<div class = "template-heading">Template</div>
<div class="component-bar">
  <span>My Template</span>
  <span>Archive</span>
</div>
